import React, { useState } from 'react';
import axiosInstance from '../../api/axiosInstance';

const LogbookRAInput = () => {
  const [formData, setFormData] = useState({
    jam: '',
    nomor_polisi: '',
    nomor_seal: '',
    personel_avsec_ra: '',
    petugas_acceptance: '',
    pengemudi_kargo_ra: '',
    keterangan: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/logbook-ra', formData);
      setSuccess('Form submitted successfully!');
      setFormData({ jam: '', nomor_polisi: '', nomor_seal: '', personel_avsec_ra: '', petugas_acceptance: '', pengemudi_kargo_ra: '', keterangan: '' });
    } catch (err) {
      setError(err.response?.data?.message || 'An error occurred');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-md mx-auto p-4 bg-white rounded shadow space-y-4">
      <div>
        <label className="block font-medium mb-1">Jam</label>
        <input type="time" name="jam" value={formData.jam} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nomor Polisi</label>
        <input type="text" name="nomor_polisi" value={formData.nomor_polisi} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nomor Seal</label>
        <input type="text" name="nomor_seal" value={formData.nomor_seal} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Personel Avsec RA</label>
        <input type="text" name="personel_avsec_ra" value={formData.personel_avsec_ra} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Petugas Acceptance</label>
        <input type="text" name="petugas_acceptance" value={formData.petugas_acceptance} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Pengemudi Kargo RA</label>
        <input type="text" name="pengemudi_kargo_ra" value={formData.pengemudi_kargo_ra} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Keterangan</label>
        <textarea name="keterangan" value={formData.keterangan} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Submit</button>
      {error && <p className="text-red-500 text-sm">{error}</p>}
      {success && <p className="text-green-600 text-sm">{success}</p>}
    </form>
  );
};

export default LogbookRAInput;
